import React from "react";
import AgentForm from "../Forms/AgentForm";
import ComplexForm from "../Forms/ComplexForm";
import PackageForm from "../Forms/PackageForm";
import PromotionForm from "../Forms/PromotionForm";

interface Agent {
  complexName: string;
  contractId: string;
  name: string;
  surname: string;
  id: string;
  cellNum: string;
  street1: string;
  street2: string;
  city: string;
  province: string;
  postalCode: string;
  password: string;
}
interface Complex{}
interface Package{}
interface Promotion{}

const MultiForm: React.FC<{ buttonName: string, type: "agent" | "complex" | "package" | "promotion", isDisabled: boolean, content: any}> = (props) => {
  let form;

  if(props.type === "agent"){
    form = (
      <AgentForm name={props.buttonName} isDisabled={props.isDisabled} content={props.content}/>
    );
  }else if (props.type === "complex"){
    form = (
    <ComplexForm name={props.buttonName} isDisabled={props.isDisabled}/>
    );
  }else if (props.type === "package"){
    form = (
      <PackageForm name={props.buttonName} isDisabled={props.isDisabled}/>
    );
  }else{
    form = (
      <PromotionForm name={props.buttonName} isDisabled={props.isDisabled}/>
    );
  }

  return (
    <>
    {form}
    </>
  );
};

export default MultiForm;
